// learn-to-code/src/components/Footer/Footer.js

import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <footer className="footer">
            <p> Created by Jackson Kelley</p>
            <a href="https://github.com/jkelley253" target="_blank" rel="noopener noreferrer">GitHub |</a>
            <a href="www.linkedin.com/in/jackson-kelley1" target="_blank" rel="noopener noreferrer">LinkedIn</a>
        </footer>
    );
}

export default Footer;
